INSERT INTO `jh_article` VALUES ('1', '0', '3', 'page', 'hongbao', '红包说明', '', '1.红包怎么获得？通过邀请好友获得2.红包可以做什么？可以抵扣在线支付时的实际支付金额3.一个红包能拆开多次使用吗？不能，一个红包只能一次性使用，不能分开使用。4.下单的时候使用了红包，但是后来订单取消了，红包还会返回吗？会的，订单无效后红包会自动返还到您的账户里。5.红包兑换码怎样兑换成红包，怎样查看红包？在个人中心-&gt;我的红包-&gt;兑换红包…', '1', '0', '1', '0', '0', '', '0', '0', '50', '1', '0', '1501234655');
