INSERT INTO `jh_article_content` VALUES ('1', '1', '', '', '', '<h1 style=\"font-size:16px;font-weight:normal;color:#333333;font-family:\" background-color:#eef2f5;\"=\"\">\r\n	红包说明\r\n	</h1>\r\n<p style=\"font-size:14px;color:#666666;font-family:\" background-color:#eef2f5;\"=\"\"> <span style=\"font-family:NSimSun;font-size:12px;\">1.红包怎么获得？<br />\r\n通过邀请好友获得<br />\r\n2.红包可以做什么？<br />\r\n可以抵扣在线支付时的实际支付金额<br />\r\n3.一个红包能拆开多次使用吗？<br />\r\n不能，一个红包只能一次性使用，不能分开使用。<br />\r\n4.下单的时候使用了红包，但是后来订单取消了，红包还会返回吗？<br />\r\n会的，订单无效后红包会自动返还到您的账户里。<br />\r\n5.红包兑换码怎样兑换成红包，怎样查看红包？<br />\r\n在个人中心-&gt;我的红包-&gt;兑换红包，输入兑换码进行兑换。<br />\r\n6.邀请好友了，为什么没获得红包？<br />\r\n先检查一下您是否在同一设备上进行的邀请？或者被邀请人是否通过您发给对方的链接进</span> \r\n		</p>', '112.26.23.195');
