-- ----------------------------
-- Function structure for fetchGroupAreaString
-- ----------------------------
DROP FUNCTION IF EXISTS `fetchGroupAreaString`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fetchGroupAreaString`(`polygonSerializeString` text) RETURNS text CHARSET utf8
BEGIN
	DECLARE strLen int DEFAULT 0;
	DECLARE rtnStr TEXT DEFAULT "";
	DECLARE ofs int DEFAULT 1;
	DECLARE curMod int DEFAULT 0;
	DECLARE matchStr VARCHAR(255) DEFAULT "";

	DECLARE polyOfs INT DEFAULT 0;
	DECLARE pointOfs INT DEFAULT 0;
	DECLARE pLngStr VARCHAR(255) DEFAULT "";
	DECLARE pLatStr VARCHAR(255) DEFAULT "";
	DECLARE isLng INT DEFAULT 1;
	DECLARE firstPointStr VARCHAR(255) DEFAULT "";
	DECLARE pointDataCount INT DEFAULT 0;
	
	DECLARE opt_done INT DEFAULT 0;
	DECLARE oldPolyOfs INT DEFAULT 0;
	DECLARE t_polyOfs INT DEFAULT 0;
	DECLARE t_pointOfs INT DEFAULT 0;
	DECLARE t_lngnat VARCHAR(128) DEFAULT "";
	

	DECLARE p_index CURSOR FOR (SELECT * FROM `tmp_opt_table` ORDER BY `poly` ASC,`point` ASC);
	DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET opt_done=1;
	
	SET opt_done=0;
	SET oldPolyOfs=0;
	SET strLen = 0;
	SET rtnStr = "";
	SET ofs = 1;
	SET curMod = 0;
	SET matchStr = "";
	SET polyOfs = 0;
	SET pointOfs = 0;
	SET pLngStr = "";
	SET pLatStr = "";
	SET isLng = 1;
	SET firstPointStr = "";
	SET pointDataCount = 0;
	
	#创建临时表，用来保存取到的数据
	CREATE TEMPORARY TABLE IF NOT EXISTS tmp_opt_table (
		poly INT,
		point INT,
		lnglat VARCHAR(128)
	) ENGINE=MEMORY DEFAULT CHARSET=utf8;

	SET strLen := CHAR_LENGTH(polygonSerializeString);
	IF strLen>0 THEN
		WHILE ofs<strLen DO
			SET polyOfs := polyOfs;
			SET pointOfs := pointOfs;
			IF curMod=0 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr="{" THEN
						SET curMod := 1;
						SET polyOfs := polyOfs + 1;
						SET pointOfs := 0;
				END IF;
			ELSEIF curMod=1 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr="{" THEN
					SET curMod := 2;
					SET pointOfs := pointOfs + 1;
				ELSEIF matchStr="}" THEN
					SET curMod := 0;
				END IF;
			ELSEIF curMod=2 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,3);
				IF matchStr="lng" OR matchStr="lat" THEN
					IF matchStr="lng" THEN
						SET isLng := 1;
					ELSE
						SET isLng := 0;
					END IF;
					SET ofs := ofs + 3;
					SET curMod := 3;
				ELSE
					SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
					IF matchStr="}" THEN
						SET curMod := 1;
						#退回等待点数据，这时要把接收到的点数据存入临时表，然后清空点字符串
						IF pLngStr<>"" AND pLatStr<>"" THEN
							#INSERT INTO `debug` (`info`) VALUES(CONCAT("插入点",pointStr));#DEBUG
							SET pLngStr := TRIM(pLngStr);
							SET pLatStr := TRIM(pLatStr);
							IF pointOfs=1 THEN
								SET firstPointStr := CONCAT(pLngStr," ",pLatStr);
							END IF;
							SET pLngStr := "";
							SET pLatStr := "";
							SET pointDataCount := 0;
						END IF;
					END IF;
				END IF;
			ELSEIF curMod=3 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr='"' THEN
					SET curMod := 4;
				END IF;
			ELSEIF curMod=4 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr='"' THEN
					SET pointDataCount := pointDataCount+1;
					SET curMod := 2;
					IF isLng=0 THEN
						SET pLatStr := CONCAT(pLatStr," ");
					ELSE
						SET pLngStr := CONCAT(pLngStr," ");
					END IF;
				ELSE
					IF pointDataCount<2 THEN
						IF isLng=0 THEN
							SET pLatStr := CONCAT(pLatStr,matchStr);
						ELSE
							SET pLngStr := CONCAT(pLngStr,matchStr);
						END IF;
					END IF;
				END IF;
			END IF;
			SET ofs := ofs + 1;
		END WHILE;
		
		IF firstPointStr<>"" THEN
			SET pointOfs := pointOfs + 1;
		END IF;
	
#SELECT REPLACE(REPLACE(GROUP_CONCAT(A._ps),',',')('),'_',',') AS str FROM (SELECT REPLACE(GROUP_CONCAT(lnglat),',','_') AS _ps FROM tmp_table GROUP BY poly) A
	#SELECT B.str FROM (SELECT REPLACE(REPLACE(GROUP_CONCAT(A._ps),',',')('),'_',',') AS str FROM (SELECT REPLACE(GROUP_CONCAT(lnglat),',','_') AS _ps FROM tmp_opt_table GROUP BY poly) A) B INTO rtnStr;

		OPEN p_index;
		FETCH p_index INTO t_polyOfs,t_pointOfs,t_lngnat;
		IF opt_done<>1 THEN
			SET oldPolyOfs := t_polyOfs;
		END IF;
		SET polyOfs := 0;
		WHILE opt_done<>1 DO
			#INSERT INTO `debug` (`info`) VALUES(CONCAT(CONCAT(" ",t_pointOfs)," ",t_lngnat));
			IF t_polyOfs<>oldPolyOfs THEN
				SET oldPolyOfs := t_polyOfs;
				SET rtnStr := CONCAT(rtnStr,")),((");
				SET polyOfs := polyOfs + 1;
			END IF;
			SET rtnStr := CONCAT(rtnStr,CONCAT(",",t_lngnat));
			FETCH p_index INTO t_polyOfs,t_pointOfs,t_lngnat;
		END WHILE;
		CLOSE p_index;
		
		IF rtnStr<>"" THEN
			SET rtnStr := REPLACE(rtnStr,"(,","(");
			SET rtnStr := SUBSTR(rtnStr,2);
			SET rtnStr := CONCAT("((",rtnStr,"))");
			#IF polyOfs>0 THEN
			#	SET rtnStr := CONCAT("(",rtnStr,")");
			#END IF;
		END IF;

		#删除所有数据
		DELETE FROM tmp_opt_table WHERE 1=1;
	END IF;
	RETURN rtnStr;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for fetchShopAreaString
-- ----------------------------
DROP FUNCTION IF EXISTS `fetchShopAreaString`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fetchShopAreaString`(`polygonSerializeString` text) RETURNS text CHARSET utf8
BEGIN
	

	DECLARE strLen int DEFAULT 0;
	DECLARE rtnStr TEXT DEFAULT "";
	DECLARE ofs int DEFAULT 1;
	DECLARE curMod int DEFAULT 0;
	DECLARE matchStr VARCHAR(255) DEFAULT "";

	DECLARE polyOfs INT DEFAULT 0;
	DECLARE pointOfs INT DEFAULT 0;
	DECLARE pLngStr VARCHAR(255) DEFAULT "";
	DECLARE pLatStr VARCHAR(255) DEFAULT "";
	DECLARE isLng INT DEFAULT 1;
	DECLARE firstPointStr VARCHAR(255) DEFAULT "";
	DECLARE pointDataCount INT DEFAULT 0;
	
	DECLARE opt_done INT DEFAULT 0;
	DECLARE oldPolyOfs INT DEFAULT 0;
	DECLARE t_polyOfs INT DEFAULT 0;
	DECLARE t_pointOfs INT DEFAULT 0;
	DECLARE t_lngnat VARCHAR(128) DEFAULT "";
	

	DECLARE p_index CURSOR FOR (SELECT * FROM `tmp_opt_table` ORDER BY `poly` ASC,`point` ASC);
	DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET opt_done=1;
	
	SET opt_done=0;
	SET oldPolyOfs=0;
	SET strLen = 0;
	SET rtnStr = "";
	SET ofs = 1;
	SET curMod = 0;
	SET matchStr = "";
	SET polyOfs = 0;
	SET pointOfs = 0;
	SET pLngStr = "";
	SET pLatStr = "";
	SET isLng = 1;
	SET firstPointStr = "";
	SET pointDataCount = 0;
	
	#创建临时表，用来保存取到的数据
	CREATE TEMPORARY TABLE IF NOT EXISTS tmp_opt_table (
		poly INT,
		point INT,
		lnglat VARCHAR(128)
	) ENGINE=MEMORY DEFAULT CHARSET=utf8;

	SET strLen := CHAR_LENGTH(polygonSerializeString);
	IF strLen>0 THEN
		WHILE ofs<strLen DO
			SET polyOfs := polyOfs;
			SET pointOfs := pointOfs;
			IF curMod=0 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,13);
				IF matchStr="polygon_point" THEN
						SET ofs := ofs + 15;
						SET curMod := 1;
				END IF;
			ELSEIF curMod=1 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr="{" THEN
					SET curMod := 2;
				ELSEIF matchStr="}" THEN
					SET curMod := 0;
				END IF;
			ELSEIF curMod=2 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,5);
				IF matchStr="area_" THEN
					SET ofs := ofs + 5;
					SET curMod := 3;

					#复制一份起始点到最后
					IF firstPointStr<>"" THEN
						SET pointOfs := pointOfs + 1;
						SET firstPointStr := "";
					END IF;
					
					SET polyOfs := polyOfs + 1;
					SET pointOfs := 0;
					#INSERT INTO `debug` (`info`) VALUES(CONCAT("当前区域",polyOfs));#DEBUG
				END IF;
			ELSEIF curMod=3 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr="{" THEN
					SET curMod := 4;
				ELSEIF matchStr="}" THEN
					SET curMod := 0;
				END IF;
			#进入4表示进入到了点数组，要做的就是等待一个{，进入5，如果等到的是},则退回3
			#进入5就是坐标点数据，这时要取3字符，如果是lat或lng，就表示后面有数据，进入6，等待接收数据，如果都不是，则要检测当前字符，如果是}，则退回4
			#			遇到双引号"进入7，开始正式接收数据，在7中再遇到双引号"则表示数据完毕，退回5
			ELSEIF curMod=4 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr="{" THEN
					SET curMod := 5;
					SET pointOfs := pointOfs +1;
				ELSEIF matchStr="}" THEN
					SET curMod := 2;
				END IF;
			ELSEIF curMod=5 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,3);
				IF matchStr="lng" OR matchStr="lat" THEN
					IF matchStr="lng" THEN
						SET isLng := 1;
					ELSE
						SET isLng := 0;
					END IF;
					SET ofs := ofs + 3;
					SET curMod := 6;
				ELSE
					SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
					IF matchStr="}" THEN
						SET curMod := 4;
						#退回等待点数据，这时要把接收到的点数据存入临时表，然后清空点字符串
						IF pLngStr<>"" AND pLatStr<>"" THEN
							#INSERT INTO `debug` (`info`) VALUES(CONCAT("插入点",pointStr));#DEBUG
							SET pLngStr := TRIM(pLngStr);
							SET pLatStr := TRIM(pLatStr);
							IF pointOfs=1 THEN
								SET firstPointStr := CONCAT(pLngStr," ",pLatStr);
							END IF;
							SET pLngStr := "";
							SET pLatStr := "";
							SET pointDataCount := 0;
						END IF;
					END IF;
				END IF;
			ELSEIF curMod=6 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr='"' THEN
					SET curMod := 7;
				END IF;
			ELSEIF curMod=7 THEN
				SET matchStr:=SUBSTRING(polygonSerializeString,ofs,1);
				IF matchStr='"' THEN
					SET pointDataCount := pointDataCount+1;
					SET curMod := 5;
					IF isLng=0 THEN
						SET pLatStr := CONCAT(pLatStr," ");
					ELSE
						SET pLngStr := CONCAT(pLngStr," ");
					END IF;
				ELSE
					IF pointDataCount<2 THEN
						IF isLng=0 THEN
							SET pLatStr := CONCAT(pLatStr,matchStr);
						ELSE
							SET pLngStr := CONCAT(pLngStr,matchStr);
						END IF;
					END IF;
				END IF;
			END IF;
			SET ofs := ofs + 1;
		END WHILE;
	
#SELECT REPLACE(REPLACE(GROUP_CONCAT(A._ps),',',')('),'_',',') AS str FROM (SELECT REPLACE(GROUP_CONCAT(lnglat),',','_') AS _ps FROM tmp_table GROUP BY poly) A
	#SELECT B.str FROM (SELECT REPLACE(REPLACE(GROUP_CONCAT(A._ps),',',')('),'_',',') AS str FROM (SELECT REPLACE(GROUP_CONCAT(lnglat),',','_') AS _ps FROM tmp_opt_table GROUP BY poly) A) B INTO rtnStr;

		OPEN p_index;
		FETCH p_index INTO t_polyOfs,t_pointOfs,t_lngnat;
		IF opt_done<>1 THEN
			SET oldPolyOfs := t_polyOfs;
		END IF;
		SET polyOfs := 0;
		WHILE opt_done<>1 DO
			#INSERT INTO `debug` (`info`) VALUES(CONCAT(CONCAT(" ",t_pointOfs)," ",t_lngnat));
			IF t_polyOfs<>oldPolyOfs THEN
				SET oldPolyOfs := t_polyOfs;
				SET rtnStr := CONCAT(rtnStr,")),((");
				SET polyOfs := polyOfs + 1;
			END IF;
			SET rtnStr := CONCAT(rtnStr,CONCAT(",",t_lngnat));
			FETCH p_index INTO t_polyOfs,t_pointOfs,t_lngnat;
		END WHILE;
		CLOSE p_index;
		
		IF rtnStr<>"" THEN
			SET rtnStr := REPLACE(rtnStr,"(,","(");
			SET rtnStr := SUBSTR(rtnStr,2);
			SET rtnStr := CONCAT("((",rtnStr,"))");
			#IF polyOfs>0 THEN
			#	SET rtnStr := CONCAT("(",rtnStr,")");
			#END IF;
		END IF;

		#删除所有数据
		DELETE FROM tmp_opt_table WHERE 1=1;
	END IF;
	RETURN rtnStr;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for inArea
-- ----------------------------
DROP FUNCTION IF EXISTS `inArea`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `inArea`(`lng` decimal(18,10),`lat` decimal(18,10),`poly_str` text) RETURNS tinyint(1)
BEGIN
	DECLARE p_point POINT DEFAULT NULL;
	DECLARE p_polygons MULTIPOLYGON DEFAULT NULL;
	DECLARE rtnVal TINYINT DEFAULT 0;
	SET rtnVal := 0;
	SET p_point := ST_GeometryFromText(CONCAT(CONCAT(CONCAT("POINT(",lng)," ",lat),")"));
	SET poly_str := TRIM(poly_str);
	IF !ISNULL(p_point) AND poly_str<>"" THEN
		SET p_polygons := ST_GeometryFromText(CONCAT(CONCAT("MULTIPOLYGON(",poly_str),")"));
		IF !ISNULL(p_polygons) THEN
			SET rtnVal := ST_Contains(p_polygons,p_point);
		END IF;
	END IF;
	RETURN rtnVal;
END
;;
DELIMITER ;
